import "./projects-path.css";

import Card from "react-bootstrap/Card";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import { useLocation } from "react-router-dom";

import { Link } from "react-router-dom";

export default function ProjectsPath() {
  const { state } = useLocation();
  const { name, type, desc, teamNeeded } = state;
  // const { type } = useParams();
  return (
    <>
      <h1>{name}</h1>
      <Container className="paths">
        <Row className="row">
          <Col xs={12} md={4} className="col">
            <Link to={"web"} style={{ textDecoration: "none" }}>
              <div className="paths-div">Web Applications</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"android"} style={{ textDecoration: "none" }}>
              <div className="paths-div">Android Applications</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"ios"} style={{ textDecoration: "none" }}>
              <div className="paths-div">IOS Applications</div>
            </Link>
          </Col>
        </Row>

        <Row>
          <Col xs={12} md={4}>
            <Link to={"ux"} style={{ textDecoration: "none" }}>
              <div className="paths-div">User Experiance</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"ui"} style={{ textDecoration: "none" }}>
              <div className="paths-div">User Interfaces</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"security"} style={{ textDecoration: "none" }}>
              <div className="paths-div">Security Systems</div>
            </Link>
          </Col>
        </Row>
      </Container>
    </>
  );
}
